data Layer = Layer Int [Int] deriving Show
newtype Image = Image [Layer] deriving Show
newtype FinalImage = FinalImage [Int] deriving Show

width = 25
size = 6
total = width * size

initial :: Image
initial = (constructImage . rearrange) input

rearrange :: [Int] -> [(Int, [Int])]
rearrange raw = zip [0..] (chunksOf total raw)

constructImage :: [(Int, [Int])] -> Image
constructImage raw = Image $ map constructLayer raw 

constructLayer :: (Int, [Int]) -> Layer
constructLayer raw = Layer (fst raw) (snd raw) 

countSpecificDigit :: Int -> Layer -> (Layer, Int)
countSpecificDigit digit (Layer id content) = (Layer id content, length $ filter (\x -> x == digit) content)

countZero :: Layer -> (Layer, Int)
countZero = countSpecificDigit 0

imageToZeroCount :: Image -> [(Layer, Int)]
imageToZeroCount (Image layer) = map countZero layer

help :: (Layer, Int) -> Layer
help (layer, _) = layer

getLowestLayer :: [(Layer, Int)] -> (Layer, Int)
getLowestLayer layerWithCounts = foldl getSmallerLayer (Layer 0 [], 1000) layerWithCounts

getSmallerLayer :: (Layer, Int) -> (Layer, Int) -> (Layer, Int)
getSmallerLayer (layer1, count1) (layer2, count2)
    | count1 <= count2 = (layer1, count1)
    | otherwise = (layer2, count2)

getCount :: (Layer, Int) -> Int
getCount (_, count) = count

solve =
    let layer = getLowestLayer $ imageToZeroCount initial in
        (getCount $ countSpecificDigit 1 (help layer)) * (getCount $ countSpecificDigit 2 (help layer))


